import axios from "axios";
import React, { useEffect, useState } from "react";

const Slider = () => {
  let key = "e9ffcce562635a23124ca8069487f842";
  const [movie, setMovie] = useState([]);

  const effect = useEffect(() => {
    let peli;
    axios
      .get(`https://api.themoviedb.org/3/discover/movie?api_key=${key}sort_by=popularity.desc`)
      .then((res) => res.data)
      .then(
        (data) => (peli = data.results),
        console.log("esto es movie", peli)
      );
  }, []);

  return (
    <div className="slider" onChange={effect}>
      <ul>
        <li></li>
      </ul>
    </div>
  );
};

export default Slider;
